subSubSection.paragraph:
Male terminalia.
Apex of ventral median lobe narrowly emarginate and apex of dorsal lobe slightly pointed; ventral lobe longer than dorsal lobe; spined region of internal sac 7.0–7.2 × as long as basal unspined regions; spined region divided into three sections: first section with dense clustered long simple spines; no unspined gap between first and second sections; second section with sparse short simple spines; a wide unspined gap between second and third sections; third section with very sparse short simple spines (
Fig. 64a
). Eighth sternite strongly obliquely truncate at sides, apex strongly emarginate and V- shaped, with fairly dense setae arising terminally; ventral surface with dense cloud-like processes present and fairly dense short simple spines (
Fig. 64b
). Apex of eighth tergite more or less rounded and sometimes slightly emarginated; dorsal surface with dense simple spines and multi-branched spines (
Fig. 64c
). Paramere 1.7–1.98 × as long as wide, cylindrical in shape; apex rounded with long and short setae (
Fig. 64d
).

Ovipositor and spermatheca.
Ovipositor short; styli arising terminally with short hairs (
Fig. 64e
). Spermatheca clearly curved; spermathecal gland long and arising at base (
Fig. 64f
).
